Si alguien vio Stranger Things, sabe quien es la actriz que hace de 11, Millie Bobby Brown, diria que es uno de los mejores personajes de la serie, es como que dan ganas de abrazarla y tratarla como una mascota.

En fin, estaba buscando el nombre del que hace de policia, David Harbour, para eso puse en google: &quot;Stranger things reparto&quot; y aparece una lista, para mi sorpresa, borraron a Millie Brown, que carajos?, dije debe ser un error, pongo Stranger things 2 reparto y tambien la borraron de ahi.

Que carajo? por que borraron a Millie Brown? no va a estar mas en la serie? uno de los mejores personajes no va a estar mas? alguien sabe que paso? {{sticker:sg-janna}}
